    Y.later(10, this, function() {Y.namespace("Media").ywaSettings = '"projectId": "10001060972056", "documentName": "", "documentGroup": "", "ywaColo" : "large", "spaceId" : "791004339" ,"customFields" : { "12" : "classic", "13" : "" }';
                                Y.Media.YWA.init(Y.namespace("Media").ywaSettings);
    });
    Y.later(10, this, function() {if(document.onclick===YAHOO.Media.PreventDefaultHandler.newClick){document.onclick=YAHOO.Media.PreventDefaultHandler.oldClick;}
    });
});
});

YUI().use("node", function(Y) {
  (function() {
    var path = document.location.pathname,
          rm = path.match(/^\/?([^;]*)/),
          rp = (rm && rm.length > 1) ? rm[1] : "",
       items = Y.all(".yom-nav .nav .nav-0 > ul > li");
    if (items) {
      var s = items.size(),
          i = 0;
      for (; i < s-2; i++) {
        var el = items.item(i),
             a = el.one("a");
        if (a) {
          var hp = a.get("pathname"),
            hprm = hp.match(/^\/?([^;]*)/);
          (hprm && hprm.length > 1 && hprm[1] == rp) ? el.addClass("selected").addClass("post") : el.removeClass("selected");
        }}}})();});
